import { Box, makeStyles, Paper, Typography } from "@material-ui/core";
import React from "react";
import PubgMobile from "../../assets/images/pubg.png";

const useStyles = makeStyles((theme) => ({
	root: {
		marginBottom: "2rem",
		"& .MuiPaper-root": {
			"& > .MuiBox-root": {
				display: "flex",
				alignItems: "flex-start",
				justifyContent: "flex-start",
				flexWrap: "wrap",

				"& > div": {
					width: "130px",
					margin: "0 1rem 1rem",
					textAlign: "center",
				},

				"& img": {
					width: "7rem",
					borderRadius: ".8rem",
					height: "initial",
					objectFit: "cover",
					marginBottom: ".5rem",
				},
			},
		},
	},

	cardTitle: {
		display: "flex",
		alignItems: "center",
		paddingBottom: "1rem",
		borderBottom: "1px solid #ddd",
		margin: "0 1rem 1.5rem 1rem",

		"& h6": {
			fontWeight: "400",
		},

		"& .MuiTypography-root": {
			marginRight: "5px",
			paddingLeft: "5px",
		},
	},
}));

